const { Op } = require("sequelize");
const bcrypt = require("bcrypt");
const jwt = require("jsonwebtoken");
const { RoleModel, UserModel } = require("../Model");

const UserController = {
  getUser: async (req, res) => {
    if (req.params.id) {
      try {
        const User = await UserModel.findOne({
          where: {
            [Op.or]: {
              email: { [Op.like]: `%${req.params.id}%` },
              user_ID: req.params.id,
            },
          },
          include: { model: RoleModel },
        });

        if (User) {
          res.status(200).json(User);
        } else {
          res.status(404).json("Not Found");
        }
      } catch (error) {
        res.status(500).json(error);
      }
    } else {
      try {
        if (req.user.role === "ADMIN") {
          const listUser = await UserModel.findAll({ include: RoleModel });
          res.status(200).json(listUser);
        } else {
          res.status(403).json("You are not ADMIN");
        }
      } catch (error) {
        res.status(500).json(error);
      }
    }
  },
  createUser: async (req, res) => {
    try {
      const data = {
        role_ID: req.body.role_ID || "395c9132-7e13-4918-98a2-0c75a99df17f",
        email: req.body.email,
        password: req.body.password,
        fullName: req.body.fullName || "",
        city: req.body.city || "",
        district: req.body.district || "",
        avatar:
          req.body.avatar ||
          "data:image/png;base64,",
      };
      //Check Role
      const user = await UserModel.findOne({
        where: { email: req.body.email },
      });
      if (user) {
        res.status(400).json("This email is already exist");
      } else {
        //Create
        const salt = await bcrypt.genSalt(10);
        const hashed = await bcrypt.hash(data.password, salt);

        const newUser = await UserModel.create({
          role_ID: data.role_ID,
          email: data.email,
          password: hashed,
          fullName: data.fullName,
          city: data.city,
          district: data.district,
          avatar: data.avatar,
        });
        res.status(200).json(newUser);
      }
    } catch (error) {
      res.status(500).json(error);
    }
  },
  loginUser: async (req, res) => {
    try {
      const user = await UserModel.findOne({
        where: { email: req.body.email },
        include: { model: RoleModel },
      });
      if (!user) {
        return res.status(404).json("User is not exist");
      }
      const validPassword = await bcrypt.compare(
        req.body.password,
        user.password
      );
      if (!validPassword) {
        return res.status(404).json("Invalid password");
      }

      if (user && validPassword) {
        const accesstoken = jwt.sign(
          {
            user_ID: user.user_ID,
            email: user.email,
            role: user.Role.role_Name,
          },
          "123456",
          {
            expiresIn: "3d",
          }
        );

        res.send({
          message: "Login successfully",
          data: user,
          accesstoken,
        });
      }
    } catch (error) {
      res.status(500).json(error);
    }
  },
  deleteUser: async (req, res) => {
    if (req.user.role === "ADMIN" || req.user.user_ID === req.params.id) {
      try {
        const result = await UserModel.findOne({
          where: { user_ID: req.params.id },
        });
        if (result) {
          res.send({
            message: "Delete user successfully",
            listUser: await UserModel.findAll({
              include: { model: RoleModel },
            }),
          });
        } else {
          res.status(404).json("User is not exist");
        }
      } catch (error) {
        res.status(500).json(error);
      }
    } else {
      res.status(504).json("You are not allowed");
    }
  },
};

module.exports = UserController;
